const INITIAL_STATE = {
  name: '',
  email: '',
  cpf: '',
  adress: '',
  city: '',
/*   state: '',
  typePlace: '',
  resume: '',
  job: '',
  jobDescription: '', */
}

const inputsReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case "SUBMIT_FORM":
      return state;
    default:
      return state;
  }
}

export default inputsReducer;
